import React from 'react';
import Home from './Home';
import About from './Service';
import Blog from './Blog';

import './App.css'


import{Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom';



const App=()=>{

  return(

<body>

<section id="nav">
<a id='a1'>HariCharan</a>
<Router>
<a id='a2'><Link to='/' style={{textDecoration:'none',marginLeft:'300px'}}>Home</Link></a>
<a id='a3'><Link to='/About' style={{textDecoration:'none'}}>Service</Link></a>
<a id='a4'><Link to='/Blog' style={{textDecoration:'none'}}>Contact</Link></a>
<br></br>

<Switch>
<Route exact path="/" component={Home}/>
<Route exact path="/About" component={About}/>
<Route exact path="/Blog" component={Blog}/>
</Switch>
</Router>
</section>

</body>

  );
  }
export default App;
